import { useState } from "react";

const type = true;

function Tracklist( {onAddTrack} ) {
  const [tracks, setTracks] = useState([
    { name: "bad ones", artists: ["Tate Mcrae"], album: "Too Young to Be Sad", id: "?" },
    { name: "slower", artists: ["Tate Mcrae"], album: "Too Young to Be Sad", id: "?" },
    { name: "you broke me first", artists: ["Tate Mcrae"], album: "Too Young to Be Sad", id: "?" },
    { name: "rubberband", artists: ["Tate Mcrae"], album: "Too Young to Be Sad", id: "" },
    { name: "r u ok", artists: ["Tate Mcrae"], album: "Too Young to Be Sad", id: "" },
    { name: "wish i loved you in the 90s", artists: ["Tate Mcrae"], album: "Too Young to Be Sad", id: "" }
  ]);

  return (
    <div className="Tracklist">
      {tracks.map((track, index) => (
        <div key={index} className="Track" artists={track.artists} songName={track.name}>
          <h4 className="SongName">
            <a href={"https://open.spotify.com/track/" + track.id} target="_blank">{track.name}</a> <span onClick={() => onAddTrack(track)} className="type">{type ? "+": "-"}</span>
          </h4>
          <p className="SongInfo">
            {track.artists.map(artist => artist).join(', ')} | {track.album}
          </p>
        </div>
      ))}
    </div>
  );
}


export default (Tracklist);
